import React from "react";
import { Card, Col, Container, Row, CardImg } from "reactstrap";
import Hat from '../static/images/rhat-square-nobg.png';

const ProductDetail = () => {
  return (
    <Container className="product-detail-container container min-vh-100">
      <Row className="row h-100 justify-content-center align-items-center">
        <Col className="product-img">
          <Card>
            <CardImg top width="100%" src={Hat} alt="cap image"/>
          </Card>
        </Col>

      </Row>
    </Container>
  )
}

export default ProductDetail;
